import { styled } from 'styled-components'

const StyledInput = styled.section`
  background-color: #233945;
  width: 80%;
  color: #FFFFFF;
  box-sizing: border-box;
  padding: 10px;
  height: 60%;
  overflow: hidden;
  display: flex;
  flex-direction: column;
  gap: 20px;
  border: 2px solid #273e4a
`

const Textbox = ({ title, text }) => {
  return (
    <>
      <StyledInput>
        <div style={{ fontSize: '2em', fontWeight: 'bold'}}>{title}</div>
        <div style={{ fontSize: '1.8em'}}>{text}</div>
      </StyledInput>
    </>
  )
}

export default Textbox
